DROP TABLE IF EXISTS `venda_prazo`;
CREATE TABLE `venda_prazo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cliente_id` int(11) NOT NULL,
  `parcela` varchar(255) COLLATE latin1_bin DEFAULT NULL,
  `data_parcela` date DEFAULT NULL,
  `valor_parcela` decimal(10,2) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT 1 COMMENT '0 - pago\n1 aberto\n2 atraso\n',
  `venda_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_venda_prazo_cliente1_idx` (`cliente_id`),
  KEY `fk_venda_prazo_venda1_idx` (`venda_id`),
  CONSTRAINT `fk_venda_prazo_cliente1` FOREIGN KEY (`cliente_id`) REFERENCES `cliente` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_venda_prazo_venda1` FOREIGN KEY (`venda_id`) REFERENCES `venda` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_bin;

